function getTestData(webApiUrl) {
    // Get id from URL
    let id = 0;
    const urlElement = webApiUrl.split('/')[3];
    if (Number.isInteger(parseInt(urlElement))) {
        id = parseInt(urlElement);
    }

    // Return data based on URL
    if (webApiUrl.toLowerCase().startsWith("/test/client")) {
        if (id != 0) {
            return clients.find(x => x.id === id);
        }
        return clients;
    }
    else if (webApiUrl.toLowerCase().startsWith("/test/user")) {
        if (id != 0) {
            return users.find(x => x.id === id);
        }
        return users;
    }
    else if (webApiUrl.toLowerCase().startsWith("/test/workitem")) {
        if (id != 0) {
            return workItems.find(x => x.id === id);
        }
        return workItems;
    }
    return null;
}

export function getListValues(valueLists, listName) {
    const valueList = valueLists.find((array) => array.Name === listName);
    return valueList.Values;
}

export function saveData(webApiUrl, data, setIsSaving, setIsSaved, setError, setShowConfirmation) {
    (async () => {
        try {
            setIsSaving(true);
            setIsSaved(false);

            // Make Web API call
            const response = await fetch(webApiUrl, {
                method: 'PUT',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            // Handle Web API response
            if (response.ok) {
                const isSaved = await response.json();
                setIsSaved(isSaved);
                if (!isSaved) {
                    setError({
                        title: 'WepAPI Error',
                        message: 'There was an issue saving the data.',
                        details: 'Error details go here...',
                        url: webApiUrl
                    });
                }

                let timeoutId;
                const durationSeconds = 2;
                setShowConfirmation(true);
                timeoutId = setTimeout(() => {
                    setShowConfirmation(false);
                }, durationSeconds * 1000);
                return () => clearTimeout(timeoutId);
            }
            else {
                setError({
                    title: 'HTTP Error',
                    message: 'There was an issue saving the data.',
                    details: response.status + ' - ' + response.statusText,
                    url: webApiUrl
                });
            }
        } catch (error) {
            setError({
                title: 'WepAPI Error',
                message: 'There was an issue saving the data.',
                details: error.toString(),
                url: webApiUrl
            });
        } finally {
            setIsSaving(false);
        }
    })();
}

export function getFormattedDate(params) {
    if (!params || !params.value) {
        return 'Not Set';
    }
    return moment(params.value).format('MM/DD/YYYY');
}

export function getClientType(params) {
    return !params.value ? params.data.TaskType : params.value + (!params.data.TaskType ? '' : ' (' + params.data.TaskType + ')');
}

export function getClientLink(params) {
    const href = '/client/' + params.data.ClientId;
    return <span><a href={href}>{params.value}</a></span>;
}

export function getStringValue(params) {
    return !params || !params.value
        ? 'Not Set'
        : params.value;
}

export function getFormattedCurrency(params) {
    return new Intl.NumberFormat('en-US', {
        style: 'currency',
        currency: 'USD',
    }).format(params.value);
}

export function getFormattedDecimal(params) {
    return new Intl.NumberFormat('en-US', {
        style: 'decimal',
    }).format(params.value);
}

export function getFormattedPercent(params) {
    return new Intl.NumberFormat('en-US', {
        style: 'percent',
    }).format(params.value);
}

export function getContactLink(params) {
    const href = '/contact/' + params.data.ContactId;
    return <a href={href}>{params.value}</a>;
}

export function getEmailLink(params) {
    const href = 'mailto:' + params.value;
    return <a href={href}>{params.value}</a>;
}